import React, { Component } from 'react';

class Counter extends Component {
    state = {
        count:0,
        tags:['tag1','tag2','tag3']
    }



    render() {


        return (
            <div>
                <ul>
                    <li>
                        {this.state.tags.map(tag => <li key = {tag}>{tag}</li>)}
                    </li>
                </ul>
            </div>
        )
    }


}

export default Counter;
